(1, 23, '4.2米货车', 400.00, 15, 10.00, 300, 9.00, 500, 8.00, '标准说明：\n1、4.2米厢货车和依维柯车配备2-3名搬运工；\n2、面包车配备1-2名搬运工。\n3、超过15公里，超出部分厢货车或依维柯按照10元/公里、面包车按照6元/公里加收超公里费。\n4、300公里以上九折、500公里以上八折优惠。（以百度地图推荐路线为准）\n5、19点以后出单按总价加收30%夜间服务费；23点以后出单按总价加收50%夜间服务费。'),
(2, 24, '依维柯', 300.00, 15, 10.00, 300, 9.00, 500, 8.00, '标准说明：\n1、4.2米厢货车和依维柯车配备2-3名搬运工；\n2、面包车配备1-2名搬运工。\n3、超过15公里，超出部分厢货车或依维柯按照10元/公里、面包车按照6元/公里加收超公里费。\n4、300公里以上九折、500公里以上八折优惠。（以百度地图推荐路线为准）\n5、19点以后出单按总价加收30%夜间服务费；23点以后出单按总价加收50%夜间服务费。'),
(3, 41, '面包车', 150.00, 15, 5.00, 300, 9.00, 500, 8.00, '标准说明：\r\n1、4.2米厢货车和依维柯车配备2-3名搬运工；\r\n2、面包车配备1-2名搬运工。\r\n3、超过15公里，超出部分厢货车或依维柯按照10元/公里、面包车按照6元/公里加收超公里费。\r\n4、300公里以上九折、500公里以上八折优惠。（以百度地图推荐路线为准）\r\n5、19点以后出单按总价加收30%夜间服务费；23点以后出单按总价加收50%夜间服务费。');
