INSERT INTO `order_type_describe` (`id`, `type`, `describe`) VALUES
(1, 1, '1、以上拆装项目已包含包装及包装材料在内。\n2、空调拆装不包含高空作业费，材料费，具体按：铜管80元/米、加雪种60元/台、洗机80元/台另行收费。\n3、其中床6颗以下的螺丝免费拆装。空周类增加的费用另计。'),
(2, 2, '1、上表中未包含套件请与队长现场另行协商费用。\n2、钢琴走上下楼梯需另外收取50元/层楼层费。'),
(5, 3, '1、本报价评估系统未尽收费项目请与搬运队长协商。\n2、需提供纸箱按13元/个另行收费，规格50*40*50cm,30个以上免费送货。\n3、如因甲方原因导致等待时间超过1小时，按100元/小时.车收取等时费。\n4、本报价不包含停车费和路桥费。'),
(6, 4, '把要搬的物品以房间为单位，以视频或者图片的形式上传到，7：30—21:30值班时间，工作人员10分钟内报出准确价格。');
