INSERT INTO `sys_information` (`id`, `title`, `img_describe`, `create_at`) VALUES
(13, '贺万家灯火搬家小程序正式上线！', '<p>&nbsp; &nbsp;经过技术部同事的努力下，万家灯火搬家小程序正式上线运营。</p>', '2018-04-09 16:21:56'),
(15, '发票申请发货时间说明', '<p>由于后台数据量较到，发票申请发货时候为1-3个工作日。</p>', '2018-04-09 16:30:43'),
(17, '五大行地产中介租房即送500元搬家体验券', '<p>&nbsp; &nbsp; &nbsp; &nbsp;即日起从链家、中原、美联、乐有家、世华等五大行地产中介公司互联网平台或门店租房就有机会享受500元搬家体验券。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;本促销活动由万家灯火提供200张价值500元/张搬家体验券，以五大行地产中介公司租赁合同签订时间为准，先到先得，送完为止！</p><p>&nbsp; &nbsp; &nbsp; （优惠券的获取和使用方式见五大行门店广告及万家灯火网站、公众号、小程序等平台）</p><p><br></p>', '2018-10-26 12:01:37'),
(20, '关于2019年年假公告', '<p>万家灯火搬迁有限公司放假通知：从2019年28号始至2019年2月12号止，给您造成不便，深感抱歉，祝您新春大吉，万事如意。&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; --------万家灯火致！</p>', '2019-01-27 09:05:15'),
(21, '视频下单系统，解决搬家过程中最大痛点！', '<p>&nbsp; &nbsp;万家灯火下单预约系统新增视频下单系统，客户通过把要搬的物品以图片或短视频的形式上传到系统后台，工作人员将在10分钟内做出准确报价，通过视频或图片报出的价格如同工作人员现场踏勘，不允许增加一分钱！</p><p>&nbsp; &nbsp; &nbsp;该系统有效解决了搬家公司临时加价的最大痛点，如发现通过视频下单后工人还要求加钱的现象，可打400-700-8942进行投诉，加价部分公司将进行10赔偿。</p>', '2019-07-27 16:28:39');
